Преимущества приложения Якитория:
• скидка на первый заказ по промокоду FIRST
• онлайн оплата заказа;  
• возможность оформления предварительного заказа;
• выбор удобного способа получения заказа; 
• скидка 20% при самовывозе заказа из кафе; 
• отслеживание статуса заказа; 
• сохранение истории всех заказов; 
• карта с координатами ближайших кафе; 
• ваши избранные блюда.
• программа лояльности с вкусными подарками.

Сумма минимального заказа – 990 рублей с учетом всех скидок. Заказы принимаются с 10:00 до 04:45

Доставка осуществляется по г. Москве и ближнему Подмосковью, Воронеж, Тверь, Пенза, Екатеринбург. 
Время доставки: По Москве - 45минут, по остальной территории время доставки можно посмотреть на нашей карте.*

